*{
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    scroll-behavior: smooth;
}
body{
    font-family:  Tahoma, Verdana, sans-serif;
    min-height: 100vh;
    overflow-x: hidden;
}
.banner{
    background: url(/images/bg.jpg);
    display: flex;
    align-items: center;
    justify-content: center;
    position: relative;
    width: 100%;
    min-height: 100vh;
}
.banner p{
    font-weight: 300;
    color: #fff;
}
.banner .content{
    max-width: 900px;
    text-align: center;
}
.content h1{
    font-size: 5rem;
    color: #fff;
}
 .btn{
    color: #fff;
    padding: 10px 30px;
    text-transform: uppercase;
    display: inline-block;
    font-size: 1rem;
    background: #ff0157;
    text-decoration: none;
    transition: 0.5s;
    letter-spacing: 2px;
    margin-top: 20px;
}
 .btn:hover{
    letter-spacing: 5px;
}
header{
    position: fixed;
    width: 100%;
    top: 0;
    left: 0;
    padding: 10px 100px;
    z-index: 10000;
    display: flex;
    justify-content: space-between;
    align-items: center;
    transition: 0.5s;
}
header.sticky{
    padding: 10px 100px;
    background: #fff;
    box-shadow: 0 5px 20px rgba(0, 0, 0, 0.05);
}
header.sticky .logo{
    color:#111;
}
header.sticky .navigation li a{
    border: 1px solid #f60052;
    background:#e91159 ;
    border-radius: 20px;
    box-shadow: 5px 5px 10px rgba(0, 0, 0, 0.5);
    padding: 10px;
    color: #111;
    transition: 0.9s;
}
header .navigation li a:hover {
  color: #fff;
  font-weight: 300;
  box-shadow: 5px 5px 10px rgba(0, 0, 0, 0.05);
  transform: scale(1.5);
  transition: 0.5;
}
header .logo{
    color: #fff;
    font-size:2rem ;
    font-weight: 700;
    text-decoration: none;
    flex-basis: 50%;
}
header .logo span{
    color: #ff0157;
}
header .navigation{
    display: flex;
    position: relative;
    right: 10px;
}
header .navigation li{
    margin-left: 30px;
    list-style: none;
}
header .navigation li a{
    text-decoration: none;
    font-weight: 300;
    color: #fff;
}
.row{
    margin: 50px 20px;
    display: flex;
    width: 100%;
}
.row .col-50{
    width: 48%;
}
.row .col-50 h2{
    font-size: 3rem;
}
.span{
    color: #ff0157;
}
.row .col-50 p{
    margin-top: 40px;
    font-size: 28px;
    padding: 10px 50px;
    color: #750909da;
    
}
.row .col-50 .imgbox{
    width: 100%;
    height: 500px;
    position: relative;
}
.row .col-50 .imgbox img{
   object-fit: cover;
   height: 90%;
   width: 90%;
   position: absolute;
   right: 0;
} 

.title{
    font-size: 2rem;
    width: 100%;
    flex-direction: column;
    display: flex;
    justify-content: center;
    align-items: center;
    margin-bottom: 45px;
}
.menu .content{
    width: 100%;
    margin-left: 50px;
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
}
.content .content-box{
    width: 30%;
    text-align:left ;
}
.content .content-box .imgbox{
    width: 70%;
    position: relative;
    padding: 20px 20px;
}
.content-box .imgbox img{
    position: relative;
    width: 100%;
}
.content .content-box .text{
    margin-left: 85px;
    margin-bottom: 10px;
    margin-top: -8px;
}
.menu #sub-title{
    margin: 20px auto;
}
.expert .expert-content{
    position: relative;
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
    width: 100%;
}
.expert-content .title{
    margin-top: 55px;
    margin-bottom: 30px;
}
.expert-content .imgbox{
    position: relative;
    width: 100%;
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
}
.expert-content .imgbox .img{
    position: relative;
    width: 18%;
    margin: 10px 30px;
}
.expert-content .imgbox .img img{
    width: 100%;
    height: 90%;
}
.testimonials{
    background: url(/images/bg2.jpg);
    background-size: cover;
}
.parent{
    display: flex;
    justify-content: center;
    align-items: center;
   flex-wrap:wrap ;
}
.testi-title h1{
    font-size: 2rem;
    color: rgb(255, 0, 0);
    margin: 29px auto;
}
.testi-title p{
    font-size: 1rem;
    color: #fff;
    margin-bottom: 50px;
}
.parent .container{
    width: 100%;
    display: flex;
    justify-self: center;
    margin-left: 130px;
}
.parent .container .testi{
    width: 25%;
    margin: 40px ;
    background: #fff;
    height: 500px;
    padding: 20px;
}
.parent .container .testi img{
    width: 130px;
    height: 130px;
    border-radius: 50%;
    position: relative;
    margin-left:70px ;
    margin-top: 20px;
    margin-bottom: 30px;
}
.parent .container .testi p{
    font-size:20px;
    margin-bottom: 50px;
}
.parent .container .testi h3{
 font-size: 1.5rem;
 
}
 
.arrow{
    background: #fff;
    z-index: 10000;
    position: fixed;
    right: 10px;
    bottom: 30px;
    width: 40px;
    height: 40px;
    border-radius: 50%;
    text-align: center;
    justify-content: center;
    cursor: pointer;
}
.fa-arrow-circle-down{
    font-size: 2.5rem;
    cursor: pointer;
    color: #e91159;
}
.download{
    background: #111;
    color: #f50354;
    display: flex;
    justify-content: center;
    align-items: center;
    padding: 10px;
    right: 100px;
    width: 300px;
    position: fixed;
    bottom: 10px;
    transition: 0.8s;
    transform: translateX(400px);
}
.toggle{
    transform: translateX(0);
}
.download.qrcode{
    width: 50%;
    height: 90%;
}
.qrcode .fa{
    height: 100%;
    font-size: 6rem;
}
.download .store{
    margin: 20px;
}
.store h2{
   margin-top:10px ;
}
.arrow:hover{
  transform: scale(1.2);
}
